import React, { Component } from 'react'
import "../../Css/Dashboard.css";
import { showAllProject } from '../../actions/projectAction.js'
import { connect } from 'react-redux';
import PropTypes from 'prop-types';



 class Dashboard extends Component {
    render() {
        return (
            <div className="dashboard">
                <div className="navName">
                    <h4>Dashboard</h4>
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quos, quaerat eaque. Harum sunt explicabo quam minima veniam possimus odit officiis?</p>
                </div>
                <hr/>
                <div className="dashBoard_body">
                    
                </div>
            </div>
        )
    }
}
Dashboard.propTypes = {
  register: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  errors: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  errors: state.errors
});
export default connect(mapStateToProps, {  showAllProject })(Dashboard);
